import React, { useState } from "react";
import { useHistory } from "react-router-dom";
import Map from "./Map";

function Travelling({ travelMode }) {
  const history = useHistory();
  console.log(travelMode);

  const [modalShowing, setModalShowing] = useState(false);

  function handleModeSelect(e) {
    console.log("okay you did it");
  }

  return (
    <div id="wrapper">
      <div className="content">
        {/* the line below gives an issue when you refresh the page */}
        <h3>{travelMode}!</h3>
        <div>
          {travelMode === "Tourism"
            ? "Roam around freely!"
            : travelMode === "Find Yourself"
            ? "Guess your location!"
            : "Find your way to a GIVEN-PLACE"}
        </div>
        <br></br>
        <div className="content-button" onClick={() => history.push("/")}>
          Warp Back to Airport
        </div>
        <div className="content-button" onClick={() => setModalShowing(true)}>
          Make a guess!
        </div>
      </div>
      <div className="background">
        <Map />
      </div>

      <div className={modalShowing ? "modal-bg bg-active" : "modal-bg"}>
        <div className="modal">
          Choose your mode!
          <div className="mode-button" onClick={handleModeSelect}>
            Find Yourself
          </div>
          <div className="mode-button" onClick={handleModeSelect}>
            Mission Mode
          </div>
          <div className="mode-button" onClick={handleModeSelect}>
            Tourism
          </div>
          <span
            className="close-mode-box"
            onClick={(e) => setModalShowing(false)}
          >
            nvm lol
          </span>
        </div>
      </div>
    </div>
  );
}

export default Travelling;
